import React from 'react'
import DataEntryType from '../components/ImportSection';
import styled from '@emotion/styled';

const StyledMain = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`;

const Home = () => {
    return (
        <StyledMain>
            <DataEntryType 
                name="Import"/>
            <DataEntryType 
                name="Paste"/>
            <DataEntryType 
                name="Manual"/>
        </StyledMain>
    )
}

export default Home;
